     4â†’(function () {
     5â†’  var statusEl = document.getElementById('status');
     6â†’  var statusDetailsEl = document.getElementById('statusDetails');
     7â†’  var authGroupEl = document.getElementById('authGroup');
     8â†’  var authChoiceEl = document.getElementById('authChoice');
     9â†’  var logEl = document.getElementById('log');
    10â†’
    11â†’  // Debug console
    12â†’  var consoleCmdEl = document.getElementById('consoleCmd');
    13â†’  var consoleArgEl = document.getElementById('consoleArg');
    14â†’  var consoleRunEl = document.getElementById('consoleRun');
    15â†’  var consoleOutEl = document.getElementById('consoleOut');
    16â†’
    17â†’  // Config editor
    18â†’  var configPathEl = document.getElementById('configPath');
    19â†’  var configTextEl = document.getElementById('configText');
    20â†’  var configReloadEl = document.getElementById('configReload');
    21â†’  var configSaveEl = document.getElementById('configSave');
