    33â†’  function isInteractiveOAuth(optionValue, optionLabel) {
    34â†’    var v = String(optionValue || '');
    35â†’    var l = String(optionLabel || '');
    36â†’    return l.indexOf('OAuth') !== -1 || v.indexOf('cli') !== -1 || v.indexOf('codex') !== -1 || v.indexOf('portal') !== -1;
    37â†’  }
    38â†’
    39â†’  function renderAuth(groups) {
    40â†’    authGroupEl.innerHTML = '';
    41â†’
    42â†’    // Toggle for showing interactive OAuth choices.
    43â†’    var advancedToggle = document.getElementById('showAdvancedAuth');
    44â†’    if (!advancedToggle) {
    45â†’      advancedToggle = document.createElement('label');
    46â†’      advancedToggle.style.display = 'block';
    47â†’      advancedToggle.style.marginTop = '0.5rem';
    48â†’      advancedToggle.innerHTML = '<input type="checkbox" id="showAdvancedAuth" /> Show interactive OAuth options (advanced)';
    49â†’      // Insert before authChoiceEl (not its parentNode) to avoid DOM error
    50â†’      authGroupEl.parentNode.insertBefore(advancedToggle, authChoiceEl);
    51â†’    }
    52â†’
    53â†’    for (var i = 0; i < groups.length; i++) {
    54â†’      var g = groups[i];
    55â†’      var opt = document.createElement('option');
    56â†’      opt.value = g.value;
    57â†’      opt.textContent = g.label + (g.hint ? ' - ' + g.hint : '');
    58â†’      authGroupEl.appendChild(opt);
    59â†’    }
    60â†’
    61â†’    function rerenderChoices() {
    62â†’      var sel = null;
    63â†’      for (var j = 0; j < groups.length; j++) {
    64â†’        if (groups[j].value === authGroupEl.value) sel = groups[j];
    65â†’      }
    66â†’      authChoiceEl.innerHTML = '';
    67â†’      var opts = (sel && sel.options) ? sel.options : [];
    68â†’      var showAdv = Boolean(document.getElementById('showAdvancedAuth') && document.getElementById('showAdvancedAuth').checked);
    69â†’
    70â†’      var firstNonInteractive = null;
    71â†’      for (var k = 0; k < opts.length; k++) {
    72â†’        var o = opts[k];
    73â†’        var interactive = isInteractiveOAuth(o.value, o.label);
    74â†’        if (interactive && !showAdv) continue;
    75â†’        if (!interactive && !firstNonInteractive) firstNonInteractive = o.value;
    76â†’
    77â†’        var opt2 = document.createElement('option');
    78â†’        opt2.value = o.value;
    79â†’        opt2.textContent = o.label + (interactive ? ' (interactive OAuth)' : '');
    80â†’        authChoiceEl.appendChild(opt2);
    81â†’      }
    82â†’
    83â†’      // Prefer selecting a non-interactive option by default.
    84â†’      if (firstNonInteractive) authChoiceEl.value = firstNonInteractive;
    85â†’    }
    86â†’
    87â†’    authGroupEl.onchange = rerenderChoices;
    88â†’    var advEl = document.getElementById('showAdvancedAuth');
    89â†’    if (advEl) advEl.onchange = rerenderChoices;
    90â†’
    91â†’    rerenderChoices();
    92â†’  }
    93â†’
    94â†’  function httpJson(url, opts) {
    95â†’    opts = opts || {};
    96â†’    opts.credentials = 'same-origin';
    97â†’    return fetch(url, opts).then(function (res) {
    98â†’      if (!res.ok) {
    99â†’        return res.text().then(function (t) {
   100â†’          throw new Error('HTTP ' + res.status + ': ' + (t || res.statusText));
   101â†’        });
   102â†’      }
   103â†’      return res.json();
   104â†’    });
   105â†’  }
   106â†’
   107â†’  function refreshStatus() {
   108â†’    setStatus('Loading...');
   109â†’    if (statusDetailsEl) statusDetailsEl.textContent = '';
   110â†’
   111â†’    return httpJson('/setup/api/status').then(function (j) {
   112â†’      var ver = j.openclawVersion ? (' | ' + j.openclawVersion) : '';
   113â†’      setStatus((j.configured ? 'Configured' : 'Not configured - run setup below') + ver);
   114â†’
   115â†’      if (statusDetailsEl) {
   116â†’        var parts = [];
   117â†’        parts.push('Gateway target: ' + (j.gatewayTarget || '(unknown)'));
   118â†’        parts.push('Tip: /healthz shows wrapper+gateway reachability.');
   119â†’        statusDetailsEl.textContent = parts.join('\n');
   120â†’      }
   121â†’
   122â†’      // If channels are unsupported, surface it for debugging.
   123â†’      if (j.channelsAddHelp && j.channelsAddHelp.indexOf('telegram') === -1) {
   124â†’        logEl.textContent += '\nNote: this openclaw build does not list telegram in `channels add --help`. Telegram auto-add will be skipped.\n';
   125â†’      }
   126â†’
   127â†’      // Attempt to load config editor content if present.
   128â†’      if (configReloadEl && configTextEl) {
   129â†’        loadConfigRaw();
   130â†’      }
   131â†’
   132â†’    }).catch(function (e) {
   133â†’      setStatus('Error: ' + String(e));
   134â†’      if (statusDetailsEl) statusDetailsEl.textContent = '';
   135â†’    });
   136â†’  }
   137â†’
   138â†’  // Fast auth group load (no subprocesses). Keeps selects from appearing empty.
   139â†’  function loadAuthGroupsFast() {
   140â†’    return httpJson('/setup/api/auth-groups').then(function (j) {
   141â†’      if (j && j.authGroups && j.authGroups.length > 0) {
   142â†’        renderAuth(j.authGroups);
   143â†’        return;
   144â†’      }
   145â†’      throw new Error('Missing authGroups from /setup/api/auth-groups');
   146â†’    }).catch(function (e) {
   147â†’      console.warn('[setup] authGroups load failed:', e);
   148â†’      renderAuth([]);
   149â†’    });
   150â†’  }
   151â†’
   152â†’  document.getElementById('run').onclick = function () {
   153â†’    var payload = {
   154â†’      flow: document.getElementById('flow').value,
   155â†’      authChoice: authChoiceEl.value,
   156â†’      authSecret: document.getElementById('authSecret').value,
   157â†’      telegramToken: document.getElementById('telegramToken').value,
   158â†’      discordToken: document.getElementById('discordToken').value,
   159â†’      slackBotToken: document.getElementById('slackBotToken').value,
   160â†’      slackAppToken: document.getElementById('slackAppToken').value,
   161â†’
   162â†’      customProviderId: document.getElementById('customProviderId').value,
   163â†’      customProviderBaseUrl: document.getElementById('customProviderBaseUrl').value,
   164â†’      customProviderApi: document.getElementById('customProviderApi').value,
   165â†’      customProviderApiKeyEnv: document.getElementById('customProviderApiKeyEnv').value,
   166â†’      customProviderModelId: document.getElementById('customProviderModelId').value
