   169â†’    logEl.textContent = 'Running...\n';
   170â†’
   171â†’    fetch('/setup/api/run', {
   172â†’      method: 'POST',
   173â†’      credentials: 'same-origin',
   174â†’      headers: { 'content-type': 'application/json' },
   175â†’      body: JSON.stringify(payload)
   176â†’    }).then(function (res) {
   177â†’      return res.text();
   178â†’    }).then(function (text) {
   179â†’      var j;
   180â†’      try { j = JSON.parse(text); } catch (_e) { j = { ok: false, output: text }; }
   181â†’      logEl.textContent += (j.output || JSON.stringify(j, null, 2));
   182â†’      return refreshStatus();
   183â†’    }).catch(function (e) {
   184â†’      logEl.textContent += '\nError: ' + String(e) + '\n';
   185â†’    });
   186â†’  };
   187â†’
   188â†’  // Debug console runner
   189â†’  function runConsole() {
   190â†’    if (!consoleCmdEl || !consoleRunEl) return;
   191â†’    var cmd = consoleCmdEl.value;
   192â†’    var arg = consoleArgEl ? consoleArgEl.value : '';
   193â†’    if (consoleOutEl) consoleOutEl.textContent = 'Running ' + cmd + '...\n';
   194â†’
   195â†’    return httpJson('/setup/api/console/run', {
   196â†’      method: 'POST',
   197â†’      headers: { 'content-type': 'application/json' },
   198â†’      body: JSON.stringify({ cmd: cmd, arg: arg })
   199â†’    }).then(function (j) {
   200â†’      if (consoleOutEl) consoleOutEl.textContent = (j.output || JSON.stringify(j, null, 2));
   201â†’      return refreshStatus();
   202â†’    }).catch(function (e) {
   203â†’      if (consoleOutEl) consoleOutEl.textContent += '\nError: ' + String(e) + '\n';
   204â†’    });
   205â†’  }
   206â†’
   207â†’  if (consoleRunEl) {
   208â†’    consoleRunEl.onclick = runConsole;
   209â†’  }
