   211â†’  // Config raw load/save
   212â†’  function loadConfigRaw() {
   213â†’    if (!configTextEl) return;
   214â†’    if (configOutEl) configOutEl.textContent = '';
   215â†’    return httpJson('/setup/api/config/raw').then(function (j) {
   216â†’      if (configPathEl) {
   217â†’        configPathEl.textContent = 'Config file: ' + (j.path || '(unknown)') + (j.exists ? '' : ' (does not exist yet)');
   218â†’      }
   219â†’      configTextEl.value = j.content || '';
   220â†’    }).catch(function (e) {
   221â†’      if (configOutEl) configOutEl.textContent = 'Error loading config: ' + String(e);
   222â†’    });
   223â†’  }
   224â†’
   225â†’  function saveConfigRaw() {
   226â†’    if (!configTextEl) return;
   227â†’    if (!confirm('Save config and restart gateway? A timestamped .bak backup will be created.')) return;
   228â†’    if (configOutEl) configOutEl.textContent = 'Saving...\n';
   229â†’    return httpJson('/setup/api/config/raw', {
   230â†’      method: 'POST',
   231â†’      headers: { 'content-type': 'application/json' },
   232â†’      body: JSON.stringify({ content: configTextEl.value })
   233â†’    }).then(function (j) {
   234â†’      if (configOutEl) configOutEl.textContent = 'Saved: ' + (j.path || '') + '\nGateway restarted.\n';
   235â†’      return refreshStatus();
   236â†’    }).catch(function (e) {
   237â†’      if (configOutEl) configOutEl.textContent += '\nError: ' + String(e) + '\n';
   238â†’    });
   239â†’  }
   240â†’
   241â†’  if (configReloadEl) configReloadEl.onclick = loadConfigRaw;
   242â†’  if (configSaveEl) configSaveEl.onclick = saveConfigRaw;
   243â†’
   244â†’  // Import backup
   245â†’  function runImport() {
   246â†’    if (!importRunEl || !importFileEl) return;
   247â†’    var f = importFileEl.files && importFileEl.files[0];
   248â†’    if (!f) {
   249â†’      alert('Pick a .tar.gz file first');
   250â†’      return;
   251â†’    }
   252â†’    if (!confirm('Import backup? This overwrites files under /data and restarts the gateway.')) return;
   253â†’
   254â†’    if (importOutEl) importOutEl.textContent = 'Uploading ' + f.name + ' (' + f.size + ' bytes)...\n';
   255â†’
   256â†’    return f.arrayBuffer().then(function (buf) {
   257â†’      return fetch('/setup/import', {
   258â†’        method: 'POST',
   259â†’        credentials: 'same-origin',
   260â†’        headers: { 'content-type': 'application/gzip' },
   261â†’        body: buf
   262â†’      });
   263â†’    }).then(function (res) {
   264â†’      return res.text().then(function (t) {
   265â†’        if (importOutEl) importOutEl.textContent += t + '\n';
   266â†’        if (!res.ok) throw new Error('HTTP ' + res.status + ': ' + t);
   267â†’        return refreshStatus();
   268â†’      });
   269â†’    }).catch(function (e) {
   270â†’      if (importOutEl) importOutEl.textContent += '\nError: ' + String(e) + '\n';
   271â†’    });
   272â†’  }
   273â†’
   274â†’  if (importRunEl) importRunEl.onclick = runImport;
