   276â†’  // Pairing approve helper
   277â†’  var pairingBtn = document.getElementById('pairingApprove');
   278â†’  if (pairingBtn) {
   279â†’    pairingBtn.onclick = function () {
   280â†’      var channel = prompt('Enter channel (telegram or discord):');
   281â†’      if (!channel) return;
   282â†’      channel = channel.trim().toLowerCase();
   283â†’      if (channel !== 'telegram' && channel !== 'discord') {
   284â†’        alert('Channel must be "telegram" or "discord"');
   285â†’        return;
   286â†’      }
   287â†’      var code = prompt('Enter pairing code (e.g. 3EY4PUYS):');
   288â†’      if (!code) return;
   289â†’      logEl.textContent += '\nApproving pairing for ' + channel + '...\n';
   290â†’      fetch('/setup/api/pairing/approve', {
   291â†’        method: 'POST',
   292â†’        credentials: 'same-origin',
   293â†’        headers: { 'content-type': 'application/json' },
   294â†’        body: JSON.stringify({ channel: channel, code: code.trim() })
   295â†’      }).then(function (r) { return r.text(); })
   296â†’        .then(function (t) { logEl.textContent += t + '\n'; })
   297â†’        .catch(function (e) { logEl.textContent += 'Error: ' + String(e) + '\n'; });
   298â†’    };
   299â†’  }
   300â†’
   301â†’  // Device pairing helper
   302â†’  var devicesRefreshBtn = document.getElementById('devicesRefresh');
   303â†’  var devicesListEl = document.getElementById('devicesList');
   304â†’
   305â†’  function approveDevice(requestId) {
   306â†’    if (!requestId) return;
   307â†’    if (!confirm('Approve device request ' + requestId + '?')) return;
   308â†’    if (devicesListEl) devicesListEl.textContent = 'Approving ' + requestId + '...';
   309â†’
   310â†’    return httpJson('/setup/api/devices/approve', {
   311â†’      method: 'POST',
   312â†’      headers: { 'content-type': 'application/json' },
   313â†’      body: JSON.stringify({ requestId: requestId })
   314â†’    }).then(function (j) {
   315â†’      if (devicesListEl) devicesListEl.textContent = j.output || 'Approved.';
   316â†’      return refreshStatus();
   317â†’    }).catch(function (e) {
   318â†’      if (devicesListEl) devicesListEl.textContent = 'Error: ' + String(e);
   319â†’    });
   320â†’  }
   321â†’
   322â†’  function refreshDevices() {
   323â†’    if (!devicesListEl) return;
   324â†’    devicesListEl.textContent = 'Loading pending devices...';
   325â†’    return httpJson('/setup/api/devices/pending').then(function (j) {
   326â†’      var ids = j.requestIds || [];
   327â†’      if (!ids.length) {
   328â†’        devicesListEl.textContent = 'No pending device requests found.';
   329â†’        return;
   330â†’      }
   331â†’      devicesListEl.innerHTML = '';
   332â†’      for (var i = 0; i < ids.length; i++) {
   333â†’        (function (id) {
   334â†’          var row = document.createElement('div');
   335â†’          row.style.marginTop = '0.25rem';
   336â†’          var btn = document.createElement('button');
   337â†’          btn.textContent = 'Approve ' + id;
   338â†’          btn.style.background = '#111';
   339â†’          btn.style.marginRight = '0.5rem';
   340â†’          btn.onclick = function () { approveDevice(id); };
   341â†’          var code = document.createElement('code');
   342â†’          code.textContent = id;
   343â†’          row.appendChild(btn);
   344â†’          row.appendChild(code);
   345â†’          devicesListEl.appendChild(row);
   346â†’        })(ids[i]);
   347â†’      }
   348â†’    }).catch(function (e) {
   349â†’      devicesListEl.textContent = 'Error: ' + String(e);
   350â†’    });
   351â†’  }
   352â†’
   353â†’  if (devicesRefreshBtn) {
   354â†’    devicesRefreshBtn.onclick = refreshDevices;
   355â†’  }
   356â†’
   357â†’  document.getElementById('reset').onclick = function () {
   358â†’    if (!confirm('Reset setup? This deletes the config file so onboarding can run again.')) return;
   359â†’    logEl.textContent = 'Resetting...\n';
   360â†’    fetch('/setup/api/reset', { method: 'POST', credentials: 'same-origin' })
   361â†’      .then(function (res) { return res.text(); })
   362â†’      .then(function (t) { logEl.textContent += t + '\n'; return refreshStatus(); })
   363â†’      .catch(function (e) { logEl.textContent += 'Error: ' + String(e) + '\n'; });
   364â†’  };
   365â†’
   366â†’  // Populate provider/auth selects ASAP (fast endpoint, no subprocesses)
   367â†’  loadAuthGroupsFast();
   368â†’
   369â†’  // Load the rest of status (version/help) in parallel
   370â†’  refreshStatus();
   371â†’})();
