    10â†’
    11â†’// Migrate deprecated CLAWDBOT_* env vars â†’ OPENCLAW_* so existing Railway deployments
    12â†’// keep working. Users should update their Railway Variables to use the new names.
    13â†’for (const suffix of ["PUBLIC_PORT", "STATE_DIR", "WORKSPACE_DIR", "GATEWAY_TOKEN", "CONFIG_PATH"]) {
    14â†’  const oldKey = `CLAWDBOT_${suffix}`;
    15â†’  const newKey = `OPENCLAW_${suffix}`;
    16â†’  if (process.env[oldKey] && !process.env[newKey]) {
    17â†’    process.env[newKey] = process.env[oldKey];
    18â†’    // Best-effort compatibility shim for old Railway templates.
    19â†’    // Intentionally no warning: Railway templates can still set legacy keys and warnings are noisy.
    20â†’  }
    21â†’  // Avoid forwarding legacy variables into OpenClaw subprocesses.
    22â†’  // OpenClaw logs a warning when deprecated CLAWDBOT_* variables are present.
    23â†’  delete process.env[oldKey];
    24â†’}
    25â†’
    26â†’// Railway injects PORT at runtime and routes traffic to that port.
    27â†’// Do not force a different public port in the container image, or the service may
    28â†’// boot but the Railway domain will be routed to a different port.
    29â†’//
    30â†’// OPENCLAW_PUBLIC_PORT is kept as an escape hatch for non-Railway deployments.
    31â†’const PORT = Number.parseInt(process.env.PORT ?? process.env.OPENCLAW_PUBLIC_PORT ?? "3000", 10);
    32â†’
    33â†’// State/workspace
    34â†’// OpenClaw defaults to ~/.openclaw.
    35â†’const STATE_DIR =
    36â†’  process.env.OPENCLAW_STATE_DIR?.trim() ||
    37â†’  path.join(os.homedir(), ".openclaw");
    38â†’
    39â†’const WORKSPACE_DIR =
    40â†’  process.env.OPENCLAW_WORKSPACE_DIR?.trim() ||
    41â†’  path.join(STATE_DIR, "workspace");
    42â†’
    43â†’// Protect /setup with a user-provided password.
    44â†’const SETUP_PASSWORD = process.env.SETUP_PASSWORD?.trim();
    45â†’
    46â†’// Gateway admin token (protects OpenClaw gateway + Control UI).
    47â†’// Must be stable across restarts. If not provided via env, persist it in the state dir.
    48â†’function resolveGatewayToken() {
    49â†’  const envTok = process.env.OPENCLAW_GATEWAY_TOKEN?.trim();
    50â†’  if (envTok) return envTok;
    51â†’
    52â†’  const tokenPath = path.join(STATE_DIR, "gateway.token");
    53â†’  try {
    54â†’    const existing = fs.readFileSync(tokenPath, "utf8").trim();
    55â†’    if (existing) return existing;
    56â†’  } catch {
    57â†’    // ignore
    58â†’  }
    59â†’
    60â†’  const generated = crypto.randomBytes(32).toString("hex");
    61â†’  try {
    62â†’    fs.mkdirSync(STATE_DIR, { recursive: true });
    63â†’    fs.writeFileSync(tokenPath, generated, { encoding: "utf8", mode: 0o600 });
    64â†’  } catch {
    65â†’    // best-effort
    66â†’  }
    67â†’  return generated;
    68â†’}
    69â†’
    70â†’const OPENCLAW_GATEWAY_TOKEN = resolveGatewayToken();
    71â†’process.env.OPENCLAW_GATEWAY_TOKEN = OPENCLAW_GATEWAY_TOKEN;
    72â†’
    73â†’// Where the gateway will listen internally (we proxy to it).
    74â†’const INTERNAL_GATEWAY_PORT = Number.parseInt(process.env.INTERNAL_GATEWAY_PORT ?? "18789", 10);
    75â†’const INTERNAL_GATEWAY_HOST = process.env.INTERNAL_GATEWAY_HOST ?? "127.0.0.1";
    76â†’const GATEWAY_TARGET = `http://${INTERNAL_GATEWAY_HOST}:${INTERNAL_GATEWAY_PORT}`;
    77â†’
    78â†’// Always run the built-from-source CLI entry directly to avoid PATH/global-install mismatches.
    79â†’const OPENCLAW_ENTRY = process.env.OPENCLAW_ENTRY?.trim() || "/openclaw/dist/entry.js";
    80â†’const OPENCLAW_NODE = process.env.OPENCLAW_NODE?.trim() || "node";
    81â†’
    82â†’function clawArgs(args) {
    83â†’  return [OPENCLAW_ENTRY, ...args];
    84â†’}
    85â†’
    86â†’function resolveConfigCandidates() {
    87â†’  const explicit = process.env.OPENCLAW_CONFIG_PATH?.trim();
    88â†’  if (explicit) return [explicit];
    89â†’
    90â†’  return [path.join(STATE_DIR, "openclaw.json")];
    91â†’}
