   233â†’async function ensureGatewayRunning() {
   234â†’  if (!isConfigured()) return { ok: false, reason: "not configured" };
   235â†’  if (gatewayProc) return { ok: true };
   236â†’  if (!gatewayStarting) {
   237â†’    gatewayStarting = (async () => {
   238â†’      try {
   239â†’        lastGatewayError = null;
   240â†’        await startGateway();
   241â†’        const ready = await waitForGatewayReady({ timeoutMs: 20_000 });
   242â†’        if (!ready) {
   243â†’          throw new Error("Gateway did not become ready in time");
   244â†’        }
   245â†’      } catch (err) {
   246â†’        const msg = `[gateway] start failure: ${String(err)}`;
   247â†’        lastGatewayError = msg;
   248â†’        // Collect extra diagnostics to help users file issues.
   249â†’        await runDoctorBestEffort();
   250â†’        throw err;
   251â†’      }
   252â†’    })().finally(() => {
   253â†’      gatewayStarting = null;
   254â†’    });
   255â†’  }
   256â†’  await gatewayStarting;
   257â†’  return { ok: true };
   258â†’}
