   274â†’function requireSetupAuth(req, res, next) {
   275â†’  if (!SETUP_PASSWORD) {
   276â†’    return res
   277â†’      .status(500)
   278â†’      .type("text/plain")
   279â†’      .send("SETUP_PASSWORD is not set. Set it in Railway Variables before using /setup.");
   280â†’  }
   281â†’
   282â†’  const header = req.headers.authorization || "";
   283â†’  const [scheme, encoded] = header.split(" ");
   284â†’  if (scheme !== "Basic" || !encoded) {
   285â†’    res.set("WWW-Authenticate", 'Basic realm="OpenClaw Setup"');
   286â†’    return res.status(401).send("Auth required");
   287â†’  }
   288â†’  const decoded = Buffer.from(encoded, "base64").toString("utf8");
   289â†’  const idx = decoded.indexOf(":");
   290â†’  const password = idx >= 0 ? decoded.slice(idx + 1) : "";
   291â†’  if (password !== SETUP_PASSWORD) {
   292â†’    res.set("WWW-Authenticate", 'Basic realm="OpenClaw Setup"');
   293â†’    return res.status(401).send("Invalid password");
   294â†’  }
   295â†’  return next();
   296â†’}
