   598â†’function buildOnboardArgs(payload) {
   599â†’  const args = [
   600â†’    "onboard",
   601â†’    "--non-interactive",
   602â†’    "--accept-risk",
   603â†’    "--json",
   604â†’    "--no-install-daemon",
   605â†’    "--skip-health",
   606â†’    "--workspace",
   607â†’    WORKSPACE_DIR,
   608â†’    // The wrapper owns public networking; keep the gateway internal.
   609â†’    "--gateway-bind",
   610â†’    "loopback",
   611â†’    "--gateway-port",
   612â†’    String(INTERNAL_GATEWAY_PORT),
   613â†’    "--gateway-auth",
   614â†’    "token",
   615â†’    "--gateway-token",
   616â†’    OPENCLAW_GATEWAY_TOKEN,
   617â†’    "--flow",
   618â†’    payload.flow || "quickstart",
   619â†’  ];
   620â†’
   621â†’  if (payload.authChoice) {
   622â†’    args.push("--auth-choice", payload.authChoice);
   623â†’
   624â†’    // Map secret to correct flag for common choices.
   625â†’    const secret = (payload.authSecret || "").trim();
   626â†’    const map = {
   627â†’      "openai-api-key": "--openai-api-key",
   628â†’      "apiKey": "--anthropic-api-key",
   629â†’      "openrouter-api-key": "--openrouter-api-key",
   630â†’      "ai-gateway-api-key": "--ai-gateway-api-key",
   631â†’      "moonshot-api-key": "--moonshot-api-key",
   632â†’      "kimi-code-api-key": "--kimi-code-api-key",
   633â†’      "gemini-api-key": "--gemini-api-key",
   634â†’      "zai-api-key": "--zai-api-key",
   635â†’      "minimax-api": "--minimax-api-key",
   636â†’      "minimax-api-lightning": "--minimax-api-key",
   637â†’      "synthetic-api-key": "--synthetic-api-key",
   638â†’      "opencode-zen": "--opencode-zen-api-key",
   639â†’    };
   640â†’
   641â†’    const flag = map[payload.authChoice];
   642â†’
   643â†’    // If the user picked an API-key auth choice but didn't provide a secret, fail fast.
   644â†’    // Otherwise OpenClaw may fall back to its default auth choice, which looks like the
   645â†’    // wizard "reverted" their selection.
   646â†’    if (flag && !secret) {
   647â†’      throw new Error(`Missing auth secret for authChoice=${payload.authChoice}`);
   648â†’    }
   649â†’
   650â†’    if (flag) {
   651â†’      args.push(flag, secret);
   652â†’    }
   653â†’
   654â†’    if (payload.authChoice === "token") {
   655â†’      // This is the Anthropic setup-token flow.
   656â†’      if (!secret) throw new Error("Missing auth secret for authChoice=token");
   657â†’      args.push("--token-provider", "anthropic", "--token", secret);
   658â†’    }
   659â†’  }
   660â†’
   661â†’  return args;
   662â†’}
