   664â†’function runCmd(cmd, args, opts = {}) {
   665â†’  return new Promise((resolve) => {
   666â†’    const timeoutMs = Number.isFinite(opts.timeoutMs) ? opts.timeoutMs : 120_000;
   667â†’
   668â†’    const proc = childProcess.spawn(cmd, args, {
   669â†’      ...opts,
   670â†’      env: {
   671â†’        ...process.env,
   672â†’        OPENCLAW_STATE_DIR: STATE_DIR,
   673â†’        OPENCLAW_WORKSPACE_DIR: WORKSPACE_DIR,
   674â†’      },
   675â†’    });
   676â†’
   677â†’    let out = "";
   678â†’    proc.stdout?.on("data", (d) => (out += d.toString("utf8")));
   679â†’    proc.stderr?.on("data", (d) => (out += d.toString("utf8")));
   680â†’
   681â†’    let killTimer;
   682â†’    const timer = setTimeout(() => {
   683â†’      try { proc.kill("SIGTERM"); } catch {}
   684â†’      killTimer = setTimeout(() => {
   685â†’        try { proc.kill("SIGKILL"); } catch {}
   686â†’      }, 2_000);
   687â†’      out += `\n[timeout] Command exceeded ${timeoutMs}ms and was terminated.\n`;
   688â†’      resolve({ code: 124, output: out });
   689â†’    }, timeoutMs);
   690â†’
   691â†’    proc.on("error", (err) => {
   692â†’      clearTimeout(timer);
   693â†’      if (killTimer) clearTimeout(killTimer);
   694â†’      out += `\n[spawn error] ${String(err)}\n`;
   695â†’      resolve({ code: 127, output: out });
   696â†’    });
   697â†’
   698â†’    proc.on("close", (code) => {
   699â†’      clearTimeout(timer);
   700â†’      if (killTimer) clearTimeout(killTimer);
   701â†’      resolve({ code: code ?? 0, output: out });
   702â†’    });
   703â†’  });
   704â†’}
